-- Table structure for weixin_userinfo
-- ----------------------------
DROP TABLE IF EXISTS `weixin_userinfo`;
CREATE TABLE `weixin_userinfo` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `app_id` varchar(64) DEFAULT NULL COMMENT '应用编号',
  `openid` varchar(64) DEFAULT NULL COMMENT '微信用户标示',
  `total_account` double(10,2) DEFAULT '0.00' COMMENT '余额',
  `status` char(1) DEFAULT '1' COMMENT '1:有效 0:无效',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `sex` char(1) DEFAULT '0' COMMENT '1时是男性，值为2时是女性，值为0时是未知',
